import React from 'react';
import styles from './PizzaList.module.css'
import pizza2 from '../../data/img/image_2.png'
// import pizza3 from '../../data/img/image_3.png'
// import pizza4 from '../../data/img/image_4.png'
// import pizza5 from '../../data/img/image_5.png'

const PizzaList = () => {
    return (
        <div className={styles.container}>
            <div className={styles.pizza_item}>
                <img src={pizza2} alt="" />
                <p></p>
                <ul className={styles.ul1}>
                    <li className={styles.li1}>тонкое</li>
                    <li className={styles.li1}>традиционное</li>
                </ul>
                <ul className={styles.ul2}>
                    <li className={styles.li2}>26</li>
                    <li className={styles.li2}>30</li>
                    <li className={styles.li2}>40</li>
                </ul>
            </div>
        </div>
    );
};

export default PizzaList;
